import React from "react";
import Section from "./Section";

const Contact = (props) => (
  <Section>
    <div className="contact-container">
      <div className="contact">
        <h2>Contact Info</h2>
        <div>
          <p className="large-text">
            If you want to contact me via email, drop me a link at
            me@frankefoster.com
          </p>
          <p className="large-text">On Twitter you can find me @frankefoster</p>
          <p className="large-text">Or on LinkedIn, you can find me here</p>
        </div>
      </div>
    </div>
  </Section>
);

export default Contact;
